import React, { useState, useEffect } from 'react';
import './Payment.css';

// Simple demo payment form for testing UI only
const CheckoutForm = ({
  amount,
  currency,
  ticketId,
  onPaymentSuccess,
  onPaymentError
}) => {
  const [loading, setLoading] = useState(false);
  const [cardInfo, setCardInfo] = useState({
    number: '',
    expiry: '',
    cvc: '',
    name: ''
  });

  const handleInputChange = (field) => (e) => {
    setCardInfo(prev => ({
      ...prev,
      [field]: e.target.value
    }));
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    // Basic validation
    if (!cardInfo.number || !cardInfo.expiry || !cardInfo.cvc || !cardInfo.name) {
      onPaymentError('Vui lòng điền đầy đủ thông tin thẻ');
      return;
    }

    setLoading(true);

    // Simulate payment processing
    setTimeout(() => {
      // Simulate success/failure randomly for demo
      const isSuccess = Math.random() > 0.3; // 70% success rate

      if (isSuccess) {
        onPaymentSuccess('demo_payment_' + Date.now());
      } else {
        onPaymentError('Thẻ bị từ chối. Vui lòng thử thẻ khác.');
      }
      setLoading(false);
    }, 2000);
  };

  return (
    <form onSubmit={handleSubmit} className="payment-form">
      <div className="payment-amount">
        <h3>Tổng tiền: {new Intl.NumberFormat('vi-VN', { style: 'currency', currency: 'VND' }).format(amount)}</h3>
        <p className="currency-note">Demo thanh toán - không thực tế</p>
      </div>

      <div className="form-group">
        <label htmlFor="card-name">Tên chủ thẻ</label>
        <input
          type="text"
          id="card-name"
          value={cardInfo.name}
          onChange={handleInputChange('name')}
          placeholder="NGUYEN VAN A"
          required
        />
      </div>

      <div className="form-group">
        <label htmlFor="card-number">Số thẻ</label>
        <input
          type="text"
          id="card-number"
          value={cardInfo.number}
          onChange={handleInputChange('number')}
          placeholder="1234 5678 9012 3456"
          required
        />
      </div>

      <div className="form-row">
        <div className="form-group">
          <label htmlFor="card-expiry">Ngày hết hạn</label>
          <input
            type="text"
            id="card-expiry"
            value={cardInfo.expiry}
            onChange={handleInputChange('expiry')}
            placeholder="MM/YY"
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="card-cvc">CVC</label>
          <input
            type="text"
            id="card-cvc"
            value={cardInfo.cvc}
            onChange={handleInputChange('cvc')}
            placeholder="123"
            required
          />
        </div>
      </div>

      <button
        type="submit"
        disabled={loading}
        className="payment-button"
      >
        {loading ? 'Đang xử lý...' : `Thanh toán ${new Intl.NumberFormat('vi-VN', { style: 'currency', currency: 'VND' }).format(amount)}`}
      </button>

      <div className="demo-notice">
        <p>⚠️ Đây là phiên bản demo - không thực hiện thanh toán thực tế</p>
        <small>Để tích hợp thanh toán thật, cần kết nối với Stripe backend</small>
      </div>
    </form>
  );
};

const PaymentForm = (props) => {
  return <CheckoutForm {...props} />;
};

export default PaymentForm;
